CREATE DATABASE IF NOT EXISTS `FontanelleBot` DEFAULT CHARACTER SET utf8;
USE `FontanelleBot`;

DROP TABLE IF EXISTS `Admins`;
CREATE TABLE IF NOT EXISTS `Admins` (
  `id` BIGINT,
  `first_name` TEXT DEFAULT NULL,
  `last_name` TEXT DEFAULT NULL,
  `username` VARCHAR(32) UNIQUE DEFAULT NULL,
  `phone_number` TEXT DEFAULT NULL,
  PRIMARY KEY (`id`)
) DEFAULT CHARACTER SET utf8;

DROP TABLE IF EXISTS `DrinkingFountain`;
CREATE TABLE IF NOT EXISTS `DrinkingFountain` (
  `identifier` INT,
  `latitude` DOUBLE DEFAULT 0,
  `longitude` DOUBLE DEFAULT 0,
  `altitude` DOUBLE DEFAULT 0,
  PRIMARY KEY (`identifier`)
) DEFAULT CHARACTER SET utf8;

